import React from 'react';
import { signInWithGoogle } from '../firebase';

function Settings() {
  return (
    <div>
      <h1 className="text-white font-bold">{localStorage.getItem('userId')}</h1>
      <h1 className="text-white font-bold">{localStorage.getItem('name')}</h1>
      <h1 className="text-white font-bold">{localStorage.getItem('mail')}</h1>
      <img
        alt=""
        src={localStorage.getItem('profilePic')}
        className="rounded-full w-[3vh] mr-3"
      />
      <button type="button" onClick={signInWithGoogle}>
        Sign in with Google
      </button>
    </div>
  );
}

export default Settings;
